// car constructor
export default class Car extends Component {
    constructor(name, speed, weight, acceleration, lane, isBet) {
        super();
        this.name = name;
        this.speed = speed;
        this.weight = weight;
        this.acceleration = acceleration;
        this.lane = lane;
        this.isBet = false;
        this.setBet = this.setBet.bind(this);
        this.noBet = this.noBet.bind(this);
    }

    setBet() {
        this.isBet = true;
        console.log(this.name, this.isBet);
    }
}
